import React, { useEffect } from "react";
import { Container, Row, Col, Navbar, NavbarBrand } from "react-bootstrap";
import axios from "axios";
import "./App.css"


function App() {
  useEffect(() => {
    axios.get("http://localhost:8010/proxy", {
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json"
      }
    })
      .then(res => {
        const data = res.data;
        console.log(data)
      }).catch(error => {
        console.log(error)
      })
  });

  return (
    <Container className="container">
      <hs>Eureka dashboard</hs>
    </Container>
  );
}

export default App;
